package net.yozo.services.common;import net.yozo.core.dao.QueryModel;import java.io.Serializable;/** * 会员每日抽奖记录 *  * @author *  */public class Prize extends QueryModel implements Serializable {	private static final long serialVersionUID = 1L;	private String id;	private String account;	private String prize;	private String getPrizeDate;	public static long getSerialVersionUID() {		return serialVersionUID;	}	@Override	public String getId() {		return id;	}	@Override	public void setId(String id) {		this.id = id;	}	public String getAccount() {		return account;	}	public void setAccount(String account) {		this.account = account;	}	public String getPrize() {		return prize;	}	public void setPrize(String prize) {		this.prize = prize;	}	public String getGetPrizeDate() {		return getPrizeDate;	}	public void setGetPrizeDate(String getPrizeDate) {		this.getPrizeDate = getPrizeDate;	}}